package com.kstech.session;

import com.kstech.model.RealTime;

public class Session_RealTime {
    private String realtimeName;

    public Session_RealTime() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Session_RealTime(RealTime real) {
		super();
		this.realtimeName = real.getRealtimeName();
	}

    public String getRealtimeName() {
        return realtimeName;
    }

    public void setRealtimeName(String realtimeName) {
        this.realtimeName = realtimeName == null ? null : realtimeName.trim();
    }
}